import Calculator from "./Calculator"
import Message from "./Message"
import Box from "./Box"
import './App.css'

function App() {

    const users = [
        {
            id: 1,
            firstName: 'hossein',
            lastName: 'azhdarloo',
            age: 21
        },
        {
            id: 2,
            firstName: 'amirHossein',
            lastName: 'azhdarloo',
            age: 22
        },
        {
            id: 3,
            firstName: 'yasin',
            lastName: 'khaloyi',
            age: 23
        },
        {
            id: 4,
            firstName: 'arman',
            lastName: 'khorasani',
            age: 22
        },
        {
            id: 5,
            firstName: 'amirMohammad',
            lastName: 'roshani',
            age: 18
        },
        {
            id: 6,
            firstName: 'amirHossein',
            lastName: 'kamandloo',
            age: 21
        },
        {
            id: 7,
            firstName: 'amirMohammad',
            lastName: 'kamandloo',
            age: 17
        }
    ]

    return (
        <>
            {/* <Calculator/> */}
            {/* <Message/> */}
            {users.map( user => <Box key={user.id()} {...user} />)}
        </>
    )
}
export default App
